import React, { Component } from "react";
import "../css/Table.css";

class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      pass: "",
    };
  }

  render() {
    return (
      <div className="padd0 col-md-12">
        <input
          type="text"
          className="OneDriveInput form-control"
          value={this.state.name}
        />
        <input
          type="text"
          className="OneDriveInput form-control"
          value={this.state.pass}
        />

        <span className="btn btn-primary" onClick={this.state.Login}>
          Giri≈ü Yap
        </span>
      </div>
    );
  }

  componentDidMount() {
    this.fetcharticels();
  }

  componentWillUnmount() {}

  async LoginProccess() {
    const response = await fetch(USER_SERVICE_URL + "Articels", {
      method: "POST",
      cache: "no-cache",
      mode: "cors",
      headers: {
        "Content-Type": "application/json",
        "access-control-allow-credentials": false,
        "Access-Control-Allow-Origin": USER_SERVICE_URL + "Articels",
        Authorization: "bearer ",
      },
    });
    this.setState({
      Articels: await response.json(),
      isShow: false,
      IsFirstRun: false,
    });
  }
}

export default Login;
